    "2008-presidential-general-election-county-results-direct-download",nt"isopen":
    false,nt"url": null,nt"notes": "This data set portrays election results,
    by counties for 49 States and by election districts for Alaska, for the 2008 Presidential
    general election. Reported for each county are the popular vote count for the Democratic
    Party candidate, the Republican Party candidate, and all other votes. Also reported
    are the percentage of the vote cast for each party?s candidate, based on the total
    number of valid votes cast. Over votes (ballots which contained votes for more than
    one candidate) and under votes (ballots which contained votes for no candidate)
    are not included in the total number of votes reported. For details particular to
    each State, see the Process Steps.",nt"license_title": null,nt"extras":
